import React from 'react'

const ButtonIcon = ({icon, bgColor}) => {
    return (
        <button className={`rounded-full inline-flex items-center justify-center py-3 px-3 hover:bg-${bgColor}`}>
            {icon}
        </button>
    )
}
export default ButtonIcon
